import styles from "../styles/Item.module.css";
import ItemCard from "./ItemCard";
import itemData from "../data/itemData.js"
function Items() {
  return (
    <div className={styles.wrapper}>
      {itemData.map((item)=>{
        {itemData.map((item)=>{
          <ItemCard key={item.id}
          id={item.id}
           name={item.name}
           price={item.price}
          />
       })}

      })}

    </div>
  );
}

export default Items;
